import React, { Children } from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';

export const SidebarData = [
  {
    title: 'Australian rental market',
    children: [
      {
        title: 'Rental market overview',
        path: '/guideline/rmo',
        cName: 'nav-text'
      },
      {
        title: 'Tenant rights',
        path: '/guideline/rp',
        cName: 'nav-text'
      },
      {
        title: 'Rental process',
        path: '/guideline/rp',
        cName: 'nav-text'
      }
    ]
  },

  {
    title: 'Property searching',
    chileren: [
      {
        title: 'Local lingo',
        path: '/guideline/ll',
        cName: 'nav-text'
      },
      {
        title: 'Location',
