        cName: 'nav-text'
      },
      {
        title: 'Start searching',
        path: '/guideline/ss',
        cName: 'nav-text'
      },
    ]
  },

  {
    title: 'Deal with agents',
    children: [
      {
        title: 'Contact agency',
        path: '/guideline/ca',
        cName: 'nav-text'
      },
      {
        title: 'Inspection',
        path: '/guideline/inspection',
        cName: 'nav-text'
      },
      {
        title: 'Application',
        path: '/guideline/application',
        cName: 'nav-text'
      },
      {
        title: 'Sign the lease',
        path: '/guideline/stl',
        cName: 'nav-text'
      },
      {
        title: 'Documents',
        path: '/guideline/documents',
        cName: 'nav-text'
      },
      {
        title: 'Move in',
        path: '/guideline/mi',
        cName: 'nav-text'
      },
    ]
  },

  {
    title: 'Break rental lease',
    children: [
      {
        title: 'Communicaiton',
        path: '/guideline/communication',
        cName: 'nav-text'
      },
      {
        title: 'Lease break',
        path: '/guideline/lb',
        cName: 'nav-text'
      },
      {
        title: 'Lease transfer',
        path: '/guideline/lt',
        cName: 'nav-text'
      },
    ]
  }

]
